import React, { useState } from 'react';
import { useParams } from "react-router-dom";
import locations from "../locations.json";
import "../Locations.css";
import ArrowUp from "../assets/arrowup.png";
import Star from "../assets/star.png";

// Define InfosComponent outside of Informations component
const InfosComponent = ({ location }) => {
    const [showDescription, setShowDescription] = useState(false);
    const [showEquipments, setShowEquipments] = useState(false);
    const [descriptionHeight, setDescriptionHeight] = useState(0);
    const [equipmentsHeight, setEquipmentsHeight] = useState(0);

    const toggleDescription = () => {
        setShowDescription(!showDescription);
    };

    const toggleEquipments = () => {
        setShowEquipments(!showEquipments);
    };

    useEffect(() => {
        if (showDescription) {
            setDescriptionHeight(document.getElementById('descriptionContent').scrollHeight);
        } else {
            setDescriptionHeight(0);
        }
    }, [showDescription]);

    useEffect(() => {
        if (showEquipments) {
            setEquipmentsHeight(document.getElementById('equipmentsContent').scrollHeight);
        } else {
            setEquipmentsHeight(0);
        }
    }, [showEquipments]);

    return (
        <div className='infos__description--container'>
            <div className="infos__btn--container">
                <button type="button" className="infos__button" onClick={toggleDescription}>
                    Description
                </button>
                <img className={`arrow-up ${showDescription ? 'rotate' : ''}`} src={ArrowUp} alt="arrowup" style={{ top: `calc(20% + ${descriptionHeight / 2}px)` }} onClick={toggleDescription} />  
                {showDescription && (
                    <p id="descriptionContent" className="infos__button--text">{location.description}</p>
                )}
            </div>
            <div className="infos__btn--container">
                <button type="button" className="infos__button" onClick={toggleEquipments}>
                    Equipments
                </button>
                <img className={`arrow-up ${showEquipments ? 'rotate' : ''}`} src={ArrowUp} alt="arrowup" style={{ top: `calc(20% + ${equipmentsHeight / 2}px)` }} onClick={toggleEquipments} />

                {showEquipments && (
                    <div>
                        <ul id="equipmentsContent" className='infos__equipement--list'>
                            {location.equipments.map((equipment, index) => (
                                <li key={index}>{equipment}</li>
                            ))}
                        </ul>
                    </div>
                )}
            </div>
        </div>
    );
};

const Informations = () => {
    
    const { id } = useParams();

    // Function to get location by ID
    const getLocationById = (id) => {
        return locations.find(location => location.id === id);
    };

    const location = getLocationById(id);

    if (!location) {
        return <div>Location not found</div>;
    }

    return (
        <div className="infos__container">
            <h1 className="infos__title">{location.title}</h1>
            <p className="infos__location">{location.location}</p>
            <ul className="infos__tags">
                {location.tags.map((tag, index) => (
                    <li className="infos__tags--items" key={index}>{tag}</li>
                ))}
            </ul>
            <div className="infos__host">
                <p className="infos__host--name">{location.host.name}</p>
                <img src={location.host.picture} alt="Host" className="infos__host--picture" />
                <p className="infos__rating">{location.rating}</p>      
            </div>

            <InfosComponent location={location} />
        </div>
    );
};

export default Informations;
